import logo from './logo.svg';
import './App.css';
import React from 'react';
import Table  from './components/table';

class App extends React.Component {

  constructor(props) {
    // initializing
    super(props);
    this.details = require('./details/resume.json');
  }

  componentDidMount() {
    // Setting title of page
    document.title = "Resume";
  }



  render() {
    return (
      <div className="App">
        <Table details={this.details.Workerience} />
    </div>
    );
  }
}

export default App;
